pragma solidity >=0.4.21 <0.6.0;
contract HoneyPot {
  mapping (address => uint) public balances;
  uint public cnt1;
  uint public cnt2;
  address[] adds;
  constructor() public payable {
    put();
  }
  function put() public payable {
    balances[msg.sender] = msg.value;
    adds.push(msg.sender);
  }
  function getAddresses() public view returns( address[] memory){
    return adds;
  }
  function getCnt1() public view returns(uint){
    return cnt1;
  }
  function getCnt2() public view returns(uint){
    return cnt2;
  }
  function get() public {
    //if (!msg.sender.send(balances[msg.sender])) {
    //  revert('send failed for some reason');
    //}
    uint transferAmt = 1 ether;
    if(balances[msg.sender]>=transferAmt){
      (bool success, bytes memory returnData) = msg.sender.call.gas(20000000).value(transferAmt)("Transaction Done");
      if(success){
      //if(!msg.sender.send(balances[msg.sender])){
      cnt1++;
      }
    }else{
      cnt2++;
    }
    balances[msg.sender] = 0;
  }
  function getAddressBalance(address a) public view returns(uint) {
    return balances[a];
  }
  function getBalance() public view  returns(uint256) {
     return(address(this).balance);
  }
}
